import { Link } from "react-router-dom";
import React from "react";
import Wdata from "./WatchData";
import Navbar from "./Navbar";
import Card from "./Card";

const SCard = () => {
  return (
    <>
      {Wdata.map((product) => (
        <div className="container">
          <div className="row">
            <Link
              to={
                "/collection/" +
                product.id +
                "/" +
                product.title +
                "/" +
                product.price
              }
            >
              <>
                <Card
                  imgsrc={product.imgsrc}
                  title={product.title}
                  price={product.price}
                />
              </>
            </Link>
          </div>
        </div>
      ))}
    </>
  );
};

export default SCard;
